import { useState } from "react";

import TopLine from "../components/TopLine";
import DlHeader from "../components/DlHeader";
import DlSection from "../components/DlSection ";
import DrHeader from "../components/DrHeader";
import DrSection from "../components/DrSection";
import DateButton from "../components/DateButton";
import DiaryDate from "./DiaryDate";
import { BrowserRouter, Route, Router } from "react-router-dom";
import DiaryEditor from "./DiaryEditor";
import DiaryList from "./DiaryList";

const Section = ({ pageType }) => {



    return (
        <div className="Section">
            <TopLine />
            <div className="dMain">
                <div className="dM-l">
                    <DlHeader text={"DAILY LIFE"}/>
                    <DlSection />
                </div>
                <div className="dM-r">
                    <DrHeader />
                    <div className="DrSection">
                        {
                            pageType == "list" ? <DiaryList /> : <DiaryEditor />
                        }
                    </div>
                    {/* <DrSection pageType={pageType}/> */}
                </div>
            </div>
        </div>
    );

}

export default Section;
